<?php
class Solution {

    /**
     * 2127. Maximum Employees to Be Invited to a Meeting
     * @param Integer[] $favorite
     * @return Integer
     */
    function maximumInvitations($favorite) {
        $n = count($favorite);
        $inDeg = array_fill(0, $n, 0);
        $depth = array_fill(0, $n, 1);
    
        // Step 1: Calculate indegrees
        foreach ($favorite as $i => $f) {
            $inDeg[$f]++;
        }
    
        // Step 2: Process chains using BFS
        $queue = [];
        foreach ($inDeg as $i => $degree) {
            if ($degree === 0) {
                $queue[] = $i;
            }
        }
    
        while (!empty($queue)) {
            $cur = array_pop($queue); // Use array_pop instead of array_shift for better performance
            $nxt = $favorite[$cur];
            $depth[$nxt] = max($depth[$nxt], $depth[$cur] + 1);
            if (--$inDeg[$nxt] === 0) {
                $queue[] = $nxt;
            }
        }
    
        // Step 3: Process cycles
        $maxCycle = 0;
        $twoCycleSum = 0;
        for ($i = 0; $i < $n; $i++) {
            if ($inDeg[$i] === 0) {
                continue; // Skip nodes already processed
            }
    
            // Detect cycle and calculate its length
            $len = 0;
            $cur = $i;
            while ($inDeg[$cur] !== 0) {
                $inDeg[$cur] = 0; // Mark as visited
                $len++;
                $cur = $favorite[$cur];
            }
    
            if ($len === 2) {
                // For bi-directional pairs, add chain lengths
                $twoCycleSum += $depth[$i] + $depth[$favorite[$i]];
            } 
            else {
                // For larger cycles, track the max cycle length
                $maxCycle = max($maxCycle, $len);
            }
        }
    
        // Step 4: Return the maximum result
        return max($maxCycle, $twoCycleSum);
    }
    
}

